import{_ as o,c as u,e as q,o as p}from"./app-DujrUTg_.js";const e={};function a(r,t){return p(),u("div",null,[...t[0]||(t[0]=[q("<p>周三上午，林默和苏梦一起去图书馆学习。他们刚坐下，就看到中公教育的王老师走了过来。</p><p>&quot;林默，苏梦，你们好，&quot;王老师说道，&quot;我们中公教育想邀请你们参加我们的公考培训课程，担任助教。&quot;</p><p>&quot;王老师，我们现在正在备考公务员，没有时间担任助教，&quot;林默说道。</p><p>&quot;没关系，&quot;王老师说道，&quot;我们可以等你们考上公务员之后再邀请你们。对了，我们中公教育想和你们合作，把你们的行测和申论技巧整理成课程，分享给更多的同学。&quot;</p><p>&quot;合作？&quot;林默问道，&quot;怎么合作？&quot;</p><p>&quot;我们中公教育可以提供平台和资源，你们提供技巧和经验，我们共同开发一门公考培训课程，&quot;王老师说道，&quot;课程收入我们可以分成。&quot;</p><p>林默想了想：&quot;我们现在正在备考公务员，没有时间开发课程。等我们考上公务员之后，再考虑合作的事情吧。&quot;</p><p>&quot;好的，&quot;王老师说道，&quot;我们等你们考上公务员之后，再谈合作的事情。&quot;</p><p>王老师离开了，林默和苏梦继续学习。他们觉得培训机构的邀请是对他们的认可，但是现在他们的首要目标是考上公务员，所以暂时不想考虑其他事情。</p><p>中午，林默和苏梦一起去食堂吃饭。吃饭时，苏梦问道：&quot;林默，你觉得我们应该和培训机构合作吗？&quot;</p><p>&quot;等我们考上公务员之后，再考虑合作的事情，&quot;林默说道，&quot;现在我们的首要目标是考上公务员，其他事情都可以暂时放一放。&quot;</p><p>&quot;好，&quot;苏梦说道，&quot;我们先考上公务员，然后再考虑其他事情。&quot;</p><p>吃完饭，两人回到图书馆，继续学习。他们刚坐下，就看到华图教育的李老师走了过来。</p><p>&quot;林默，苏梦，你们好，&quot;李老师说道，&quot;我们华图教育想邀请你们参加我们的公考培训课程，担任助教。&quot;</p><p>&quot;李老师，我们现在正在备考公务员，没有时间担任助教，&quot;林默说道。</p><p>&quot;没关系，&quot;李老师说道，&quot;我们可以等你们考上公务员之后再邀请你们。对了，我们华图教育想和你们合作，把你们的行测和申论技巧整理成课程，分享给更多的同学。&quot;</p><p>&quot;我们现在正在备考公务员，没有时间开发课程，&quot;林默说道，&quot;等我们考上公务员之后，再考虑合作的事情吧。&quot;</p><p>&quot;好的，&quot;李老师说道，&quot;我们等你们考上公务员之后，再谈合作的事情。&quot;</p><p>李老师离开了，林默和苏梦继续学习。他们觉得越来越多的培训机构注意到了他们，这是对他们的认可，但是现在他们的首要目标是考上公务员，所以暂时不想考虑其他事情。</p><p>下午，林默和苏梦在图书馆学习时，遇到了粉笔教育的张老师。张老师也想邀请他们参加粉笔教育的公考培训课程，担任助教，并且想和他们合作开发课程。林默和苏梦同样以备考公务员为由，拒绝了张老师的邀请，说等考上公务员之后再考虑合作的事情。</p><p>离开图书馆时，苏梦说道：&quot;林默，今天有三个培训机构的老师来邀请我们，看来我们真的很受关注。&quot;</p><p>&quot;是的，&quot;林默说道，&quot;这说明我们的行测和申论技巧很有用，得到了培训机构的认可。&quot;</p><p>&quot;那我们考上公务员之后，应该和培训机构合作吗？&quot;苏梦问道。</p><p>&quot;可以考虑，&quot;林默说道，&quot;我们可以把花生十三的技巧分享给更多的同学，帮助他们考上公务员。&quot;</p><p>&quot;好，&quot;苏梦说道，&quot;我们考上公务员之后，就和培训机构合作，分享花生十三的技巧。&quot;</p><p>回到宿舍，林默躺在床上，回想着今天培训机构的邀请。他觉得这是对他的认可，但是现在他的首要目标是考上公务员，所以暂时不想考虑其他事情。他决定，等考上公务员之后，再考虑和培训机构合作的事情。</p><p>林默看着自己的未来规划，心中充满了希望。他知道，有了重生的机会和花生十三的技巧，他一定能实现自己的目标，创造属于自己的传奇。</p>",27)])])}const i=o(e,[["render",a]]),c=JSON.parse('{"path":"/blog/4dbxvcj8/","title":"重生之我是行测大神_第十四章","lang":"zh-CN","frontmatter":{"title":"重生之我是行测大神_第十四章","createTime":"2026/01/08 11:49:03","permalink":"/blog/4dbxvcj8/"},"readingTime":{"minutes":4.03,"words":1210},"git":{},"filePathRelative":"blog/我是公考大神/重生之我是行测大神_第十四章.md","headers":[],"categoryList":[{"id":"064e59","sort":10000,"name":"我是公考大神"}]}');export{i as comp,c as data};
